⛓️EXCELSIOR BLOCK PARTY⛓️ What a turn out! Our hearts are so full and we could not have asked for a better day. The vibes were high + the community showed up.  This is why we do what we do… bringing people together is what it’s all about.  Thank you to all those who made this event possible.  We are humbled by the recognition the City of San Francisco showed us in not one, but two awards. Thank you @ahshasafai and the SF board of Supervisors, as well as the City Assessor-Recorder Joaquin Torres for the Certificates of Honor and for recognizing our hard work and dedication to not only the Excelsior District, but the city of San Francisco.  It is truly humbling to been seen.  We want to thank Maribel Ramirez from @excelsior_ag for your dedication to this community + helping make this event possible.  Also, huge shout out to @ejslowdown @ejsf2024 who had our backs hard on this one. He is running for Board of Supervisors for district 11 + I can see no one more deserving. Another thank you to @ybca and SF Planning Commission for their aide in making events like this financially possible for small business.  And finally…. our deepest gratitude to the friends/family/clients/customers/patrons, other vendors/small businesses who participated and the artists who traveled to work the Flash Day @____the_helm. This could not have happened without you.  Annnddd, a huge congratulations to @excelsiorcoffeesf on their dual awards, WELL DESERVED!! Until next year 🫡
